const CustomizedTables = ({ StyledTableRow, StyledTableCell, item }) => {
  const {
    selling_quantity,
    selling_amount,
    insert_date,
    currency,
    buying_price,
    buying_quantity,
    buying_amount,
  } = item;
  return (
    <StyledTableRow key={item._id}>
      <StyledTableCell component="th" scope="row">
        {selling_quantity}
      </StyledTableCell>
      <StyledTableCell align="left">{selling_amount}</StyledTableCell>
      <StyledTableCell align="left">{currency}</StyledTableCell>
      <StyledTableCell align="left">{buying_price}</StyledTableCell>
      <StyledTableCell align="left">{buying_quantity}</StyledTableCell>
      <StyledTableCell align="left">{buying_amount}</StyledTableCell>
      <StyledTableCell align="left">{insert_date}</StyledTableCell>
    </StyledTableRow>
  );
};

export default CustomizedTables;
